import React from 'react'
import { Typography, AppBar, Toolbar, CssBaseline, Box, Button } from '@mui/material'

const pages = ['My Portfolio', 'My Github'];

const handleCloseNavMenu = () => {
  setAnchorElNav(null);
};

const [anchorElNav, setAnchorElNav] = React.useState(null);

const Header = () => {
  return (
      <CssBaseline>
        <AppBar position='relative'>
          <Toolbar>
            <Typography variant='h1'>Daniel's Translator Web App</Typography>
            <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
            {pages.map((page) => (
              <Button
                key={page}
                onClick={handleCloseNavMenu}
                sx={{ my: 2, color: 'white', display: 'block' }}
              >
                {page}
              </Button>
            ))}
          </Box>
          </Toolbar>
        </AppBar>
      </CssBaseline>
  )
}

export default Header
